import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';

export const Logo = () => {
  const navigate = useNavigate();

  return(
  <LogoStyled
  onClick={()=>{navigate(`/`)}}>유민몰</LogoStyled>
  )
}

const LogoStyled = styled.div`
  font-weight: 700;
  font-size: 50px;
  line-height: 26px;
`;
